      const price = await axios.get('https://api.coingecko.com/api/v3/simple/price?ids=radio-caca&vs_currencies=usd')
        .then(res => res.data['radio-caca'].usd)
      console.log(price)

    }, 20000)
    return () => {
      clearInterval(updatedPrice)
    }
  }, [])
  return (
    <div className="App">
      <RacaTabs />
    </div>

  );
}

export default App;
